Saved by the Bell: Soundtrack to the Original Hit TV Series


Saved by the Bell is an American television sitcom that aired on NBC from 1989 to 1993. The show follows a group of friends and their principal.


A CD and cassette tape soundtrack was released on April 11, 1995. It contained songs used throughout the series. The tracklisting is as follows:


 1. &quot;Saved by the Bell&quot;
 2. &quot;Don't Leave With Your Love&quot;
 3. &quot;Go for It!&quot;
 4. &quot;Love Me Now&quot;
 5. &quot;Make My Day&quot;
 6. &quot;Friends Forever&quot;
 7. &quot;Did We Ever Have a Chance?&quot;
 8. &quot;Deep Within My Heart&quot;
 9. &quot;Surfer Dude&quot;
10. &quot;Gone Hawaiian&quot;
11. &quot;School Song&quot;
12. &quot;Saved by the Bell&quot; with Michael Damian


